import React from 'react'
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/swiper-bundle.min.css";
import "swiper/swiper.min.css";
import { Pagination } from "swiper";
import {FiPlay } from "react-icons/fi";
import { Link } from "react-router-dom";
import "../style.css"
const Card = () => {
    return (
        <div className="">
      <Swiper
        slidesPerView={4}
        spaceBetween={30}
        pagination={{
          clickable: true,
        }}
        modules={[Pagination]}
        className="mySwiper"
      >
        <SwiperSlide className='card-box'>
        <section className="card-header">
        <div>
        <img src={`../images/header-banners.png`} alt="Project" className="slide-image"/>
        </div>
            <div className='card-content'>
                <h4>Lorem ipsum</h4>
                <p>Lorem ipsum</p>
                <Link to='/about' className="home-btn">Know More<span><FiPlay/></span></Link>
            </div>
        </section>
        </SwiperSlide>
        {/* <SwiperSlide>
        <section className="header-text">
        
        <div className="haeder-right">
        <img
        src={`/images/header-banners.png`}
        alt="Project"
        className="slide-image"
        /> 
        </div>
        </section>
           
                
        </SwiperSlide>
        <SwiperSlide>
        <section className="header-text">

        </section>
           
                
        </SwiperSlide> */}
      </Swiper>
        </div>
       )
}

export default Card
